initializeIcons();

interface IPath {
  path: string;
  render: () => JSX.Element;
}

class App extends React.Component<any, any> {
  private pathList: IPath[] = [
    { path: "Flight", render: this.renderFlight},
    { path: "Train", render: this.renderTrain },
    { path: "Bus", render: this.renderBus },
    { path: "Grocery", render: this.renderGrocery },
    { path: "", render: this.renderFlight }
  ];

  public render() {
    return (
      <Switch>
        {this.pathList.map(path => this.renderRoute(path))}
      </Switch>
    );
  }

  private renderRoute(path: IPath): JSX.Element {
    return <Route path={"/" + path.path} render={(props) => this.renderPivot(path)} key={path.path} />
  }

  private renderPivotItem(path: IPath): JSX.Element {
    return (
      <PivotItem linkText={path.path} itemKey={path.path} key={path.path}>
        {path.render()}
      </PivotItem>
    );
  }

  private renderPivot(selectedPath: IPath): JSX.Element {
    return (
      <Pivot linkFormat={PivotLinkFormat.tabs} selectedKey={selectedPath.path} onLinkClick={this.onPivotItemClick}>
        {this.pathList.map(pathItem => this.renderPivotItem(pathItem))}
      </Pivot>
    );
  }

  private renderGrocery(): JSX.Element {
    return <GroceryMain />
  }

  private renderFlight(): JSX.Element {
    return (
      <Generic
        Links={flightLinks}
        Options={flightOptions}
        Title={"Flights Multiple URL Opener"}
        OfferLinks={flightOffers}
      />);
  }

  private renderBus(): JSX.Element {
    return (
      <Generic
        Links={busLinks}
        Options={busOptions}
        Title={"Bus Multiple URL Opener"}
        OfferLinks={busOffers}
      />);
  }

  private renderTrain(): JSX.Element {
    return (
      <Generic
        Links={trainLinks}
        Options={trainOptions}
        Title={"Train Multiple URL Opener"}
        OfferLinks={trainOffers}
      />);
  }

  private onPivotItemClick(item: PivotItem): void {
    if (item.props.itemKey) {
      window.open(Utils.getUrl(item.props.itemKey),"_self");
    }
  }

}

